import React, { useContext } from "react";
import { UserContext } from "../Context/UserContextProvider";

function Credentials() {
  const { user } = useContext(UserContext);
  console.log(user);
  return (
    <>
        username : {user.email}
        <button on>Logout</button>
    </>
  );
}

export default Credentials;
